Ghana in 60s 🇬🇭 sharing snippets from this morning’s @beyondthereturn Panafest 2021 Wreath Laying Festival ceremony.

This is the start of a commemorative ceremony honoring the souls lost in the slave trade and to uplift all the pan-African pioneers.  More to come!
